import React, { Component } from 'react';
import { Table, Pagination, Button, Input, Icon, Divider } from 'antd'
import { Link } from 'react-router-dom'
export default class shop extends Component {
    render() {
        return (
            <div style={{ width: '100%' }}>
                <div style={{ width: '100%', display: 'flex', justifyContent: 'flex-start', alignItems: 'center' }}>
                    <div style={{ width: '10%', textAlign: 'right' }}>商品编号：</div><div>1104010041</div>
                </div>
                <div style={{ width: '100%', display: 'flex', justifyContent: 'flex-start', alignItems: 'center' }}>
                    <div style={{ width: '10%', textAlign: 'right' }}>商品名称：</div><div>喜德旺竹荪</div>
                </div>
                <div style={{ width: '100%', display: 'flex', justifyContent: 'flex-start', alignItems: 'center' }}>
                    <div style={{ width: '10%', textAlign: 'right' }}>供应商选择：</div><div>喜德旺竹荪</div>
                </div>
            </div >
        )
    }
}
